import React from 'react';
import { Col, Container } from "react-bootstrap";
import "./Leftbar.css";

const Leftbar = () => {
    return ( 
        <Col md={3} style={{background: "#121212", top: "0", bottom: "0", position: absolute}}>
            <Container>
            <h1>Hello World!</h1>
            </Container>
        </Col>
     );
}

export default Leftbar;
